import React from "react";
import PropTypes from "prop-types";
// css
import "./Home.scss";
import Banner from "../../components/Banner/Banner";

function Home(props) {
  return (
    <main className="index">
      <section className="index-banner">
        <Banner />
      </section>
      <section>
        <div className="index-boxlink-1">
          <h3>Cases</h3>
        </div>
        <div className="index-boxlink-2">
          <h3>Kairu Portfolio</h3>
        </div>
        <div className="index-boxlink-3">
          <h3>Games</h3>
        </div>
        <div className="index-boxlink-4">
          <h3>Wherer Are My Friends</h3>
        </div>
        <div className="index-boxlink-5">
          <h3>About</h3>
        </div>
        <div className="index-boxlink-6">
          <h3>Contact</h3>
        </div>
      </section>
    </main>
  );
}

Home.propTypes = {};

export default Home;
